import { Grid, Typography } from '@mui/material';
import WorkIcon from '@mui/icons-material/Work';

import './Resume.css';
import '../../App.css';
import {resumeData, about_me} from '../../utils/resumeData';
import BasicTimeline, {CustomTimelineSeperator} from "../../components/Timeline/Timeline";

export default function Resume() {

    return(
        <>
            {/* About Me */}
            <Grid container className='section pb_45'>
                <Grid item className='section_title mb_30'>
                    <span></span>
                    <h6 className='section_title_text'>About Me</h6>
                </Grid>
                <Grid item className='section_text' xs={12}>
                    <Typography variant='body2' className='about_me_text'>{about_me}</Typography>
                </Grid>
            </Grid>

            {/* Education and Experience */}
            <Grid container className='section pb_45'>
                <Grid item className='section_title mb_30'>
                    <span></span>
                    <h6 className='section_title_text'>Resume</h6>
                </Grid>
                <Grid container item xs={12}>
                    {/* Experience */}
                    <Grid item sm={12} md={6}>
                        <BasicTimeline title="Experience" icon={<WorkIcon />}>
                            {resumeData.experiences.map(experience => (
                                experience.title
                            ))}
                        </BasicTimeline>
                    </Grid>

                    {/* Education */}
                    <Grid item sm={12} md={6}></Grid>
                </Grid>
            </Grid>

            {/* Services */}
            <Grid container className='section'>

            </Grid>

            {/* Skills */}
            <Grid container className='section'>

            </Grid>

            {/* Contact */}
            <Grid container className=''>

            </Grid>
        </>
    );

}
